import React from "react";
import Navbar from "../Navbar/Navbar";

function Wishlist({ wishlist, handleAddProduct}) {

  return (
    <div>
      <Navbar/>
      {wishlist.map((item) => {
        return (
          <>
            <div key={item.id} className="cart">
              <div className="card">
                <div>
                  <img src={item.image} width="170px" alt="" />


                </div>
                <div className="item_title">{item.title.substring(0, 11)}...</div>
                <div className="qty">Qty : {item.quantity}</div>
                <div> Total Price : Rs. {item.price * item.quantity} /-</div>
                <div>
                </div>
              </div>
            </div>
          </>
        );
      })}
      <div className="final">
      <button className="btn" onClick={()=>handleAddProduct}>Add to Cart</button>
      </div>
    </div>
  );
}

export default Wishlist;
